import React from 'react';
import '../css/main.css'

class main extends React.Component{
    state={
        x:0,
        y:0
    }
    goUp=async ()=>{
        this.setState(
            ({y})=>({
                y:y-1
            })
        );
    }
    goDown=async ()=>{
        this.setState(
            ({y})=>({
                y:y+1
            })
        );
    }
    goLeft=async ()=>{
        this.setState(
            ({x})=>({
                x:x-1
            })
        );
    }
    goRight=async ()=>{
        this.setState(
            ({x})=>({
                x:x+1
            })
        );
    }
    Check=()=>{
        alert(this.state.y);
    }


    render(){
        return(
            <div class="game">
                {this.state.x},{this.state.y}
                <div class="btn up">
                    <input type="button" value="ss" onClick={this.goUp}></input>
                </div>
                <div class="middle">
                    <div class="btn left">
                        <input type="button" value="left" onClick={this.goLeft}></input>
                    </div>
                    <button onClick={this.Check}>check</button>
                    <div class="btn right">
                        <input type="button" value="right" onClick={this.goRight}></input>
                    </div>
                </div>
                <div class="btn down">
                    <input type="button" value="down" onClick={this.goDown}></input>
                </div>
            </div>
        )
    }
}

export default main;
